import Link from 'next/link';
import useSWR from 'swr'

const fetcher = (url) => fetch(url).then((res) => res.json())

function Home() {
    const { data, error } = useSWR('/api/people', fetcher)

    return (
        <div>
            <h1>Home</h1>
            <Link href="/about"><button>About</button></Link>
        </div>
    )
}

export default Home;
